    function login(){
        axios.post(config["rootApiIP"] + "/user/login", {
            userName : userName,
            password : password
        }).then(res => {
            nav(config["rootPathPrefix"] + "/home");
        }).catch(err => {
            alert("Username or password error")
        });
    };

    function submit(e){
        e.preventDefault()

        login();
    }

